-- Table: encu.rama

-- DROP TABLE encu.rama;

CREATE TABLE encu.rama
(
  ram_ram integer NOT NULL,
  ram_descripcion character varying(200),
  ram_tlg bigint,
  CONSTRAINT rama_pk PRIMARY KEY (ram_ram),
  CONSTRAINT "texto de descripción de rama inválido" CHECK (comun.cadena_valida(ram_descripcion::text, 'castellano'::text))
);
ALTER TABLE encu.rama
  OWNER TO tedede_php;

-- Table: encu.ocupacion

-- DROP TABLE encu.ocupacion;

CREATE TABLE encu.ocupacion
(
  ocu_ocu integer NOT NULL,
  ocu_descripcion character varying(200),
  ocu_tlg bigint,
  CONSTRAINT ocupacion_pk PRIMARY KEY (ocu_ocu),
  CONSTRAINT "texto de descripción de ocupacion inválido" CHECK (comun.cadena_valida(ocu_descripcion::text, 'castellano'::text))
);
ALTER TABLE encu.ocupacion
  OWNER TO tedede_php;
  
